import React, {Component} from 'react';
import './navbar.css';

class navbar extends Component{
   render(){
       return(
           <nav className="NavbarItems">
               <h1 className="nav"><img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.cookingclassy.com%2Fwp-content%2Fuploads%2F2019%2F07%2Fbirthday-cake-4.jpg&imgrefurl=https%3A%2F%2Fwww.cookingclassy.com%2Fbirthday-cake%2F&tbnid=P7zEYJbCZWUJeM&vet=12ahUKEwiegYTe-pjvAhVUIHIKHeTICycQMygBegUIARD4Ag..i&docid=fGC3f6Roz0uhPM&w=1200&h=1810&q=cake&ved=2ahUKEwiegYTe-pjvAhVUIHIKHeTICycQMygBegUIARD4Ag"/></h1>
           </nav>
       )
   }
}
export default navbar;
